import React from "react";

const Header = () => {
    return (
        <div class="col-12 pt-5">
            <p class="mb-4 pb-2">
                <h1>Dev & Data</h1>
                How confortable do you feel in dev & data?
            </p>
        </div>
    );
};

export default Header;
